import React, { useRef } from "react";
import emailjs from "@emailjs/browser";
import "./App.css";
import logo from "./logo.png";
import qr from "./qr.png";

function App() {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    const file = e.target.querySelector('input[type="file"]').files[0];
    const reader = new FileReader();

    reader.onloadend = () => {
      const base64String = reader.result;

      emailjs
        .send(
          "YOUR_SERVICE_ID",
          "YOUR_TEMPLATE_ID",
          {
            from_name: form.current.user_name.value,
            occupation: form.current.occupation.value,
            preferred_date: form.current.preferred_date.value,
            whatsapp: form.current.whatsapp.value,
            email: form.current.user_email.value,
            message: form.current.message.value,
            screenshot: base64String,
          },
          "YOUR_USER_ID"
        )
        .then(
          (result) => {
            alert("Booking sent successfully!");
          },
          (error) => {
            alert("Failed to send booking. Please try again.");
          }
        );
    };

    if (file) {
      reader.readAsDataURL(file);
    } else {
      emailjs.sendForm("YOUR_SERVICE_ID", "YOUR_TEMPLATE_ID", form.current, "YOUR_USER_ID")
        .then(
          (result) => {
            alert("Booking sent successfully!");
          },
          (error) => {
            alert("Failed to send booking. Please try again.");
          }
        );
    }
  };

  return (
    <div className="bg-stars text-white min-h-screen px-6">
      {/* Header */}
      <header className="flex justify-between items-center py-4 border-b border-gray-600">
        <div>
          <h1 className="text-3xl font-bold">SafeCircle</h1>
          <p className="text-sm text-gray-300">Confide. Connect. Heal.</p>
        </div>
        <img src={logo} alt="Logo" className="w-16 h-16 rounded-full" />
      </header>

      {/* Hero */}
      <section className="flex flex-col md:flex-row items-center justify-between py-12">
        <div className="md:w-1/2 space-y-4">
          <h2 className="text-4xl font-semibold">Welcome to SafeCircle</h2>
          <p className="text-gray-300">
            Your private space to connect, talk, and find peace. We offer confidential
            guidance tailored just for you.
          </p>
        </div>
        <img src={logo} alt="SafeCircle" className="md:w-1/4 w-32 mt-6 md:mt-0" />
      </section>

      {/* What We Do */}
      <section className="py-10">
        <h2 className="text-2xl font-bold mb-4">What We Do</h2>
        <ul className="space-y-2 text-gray-300 list-disc ml-6">
          <li>Private one-on-one consultations</li>
          <li>Guidance from expert mentors</li>
          <li>Confidential and safe environment</li>
        </ul>
      </section>

      {/* Why Trust Us */}
      <section className="py-10 bg-gray-800 rounded-xl px-6">
        <h2 className="text-2xl font-bold mb-4">Why Trust Us?</h2>
        <ul className="space-y-2 text-gray-300 list-disc ml-6">
          <li>Certified professionals</li>
          <li>Complete privacy and data protection</li>
          <li>Calm, non-judgmental support</li>
        </ul>
      </section>

      {/* Pricing */}
      <section className="py-10">
        <h2 className="text-2xl font-bold mb-4">Pricing</h2>
        <div className="grid md:grid-cols-2 gap-6">
          <div className="bg-gray-800 p-4 rounded-lg">
            <h3 className="text-xl font-semibold">Basic</h3>
            <p>₹199 - 1 session</p>
          </div>
          <div className="bg-gray-800 p-4 rounded-lg">
            <h3 className="text-xl font-semibold">Premium</h3>
            <p>₹399 - 2 sessions + priority support</p>
          </div>
        </div>
      </section>

      {/* Booking */}
      <section className="py-10" id="book">
        <h2 className="text-2xl font-bold mb-4">Book a Session</h2>
        <div className="md:flex gap-10">
          <form ref={form} onSubmit={sendEmail} className="md:w-2/3 space-y-4">
            <input name="user_name" placeholder="Your Name" className="w-full p-2 bg-gray-900 rounded" required />
            <select name="occupation" className="w-full p-2 bg-gray-900 rounded" required>
              <option value="">Select Occupation</option>
              <option value="Student">Student</option>
              <option value="Professional">Professional</option>
              <option value="Other">Other</option>
            </select>
            <input name="preferred_date" type="date" className="w-full p-2 bg-gray-900 rounded" required />
            <input name="whatsapp" placeholder="WhatsApp Number" className="w-full p-2 bg-gray-900 rounded" required />
            <input name="user_email" placeholder="Email ID" type="email" className="w-full p-2 bg-gray-900 rounded" required />
            <textarea name="message" placeholder="What's on your mind?" className="w-full p-2 bg-gray-900 rounded" required></textarea>
            <input type="file" name="screenshot" accept="image/*" className="w-full p-2 bg-gray-900 rounded" />
            <button type="submit" className="bg-blue-600 px-4 py-2 rounded">Submit</button>
            <p className="text-sm text-gray-400">Our team will contact you after confirmation of payment from our side.</p>
          </form>
          <img src={qr} alt="QR Code" className="w-48 h-auto mt-6 md:mt-0" />
        </div>
      </section>

      {/* Testimonials */}
      <section className="py-10">
        <h2 className="text-2xl font-bold mb-4">What Our Users Say</h2>
